import React from "react";
import Header from "./Header";
import Note from "./Note";
import Footer from "./Footer";
import notes from "../notes.js";


function App (){
    return (<div>
        <Header />
        <Note title={notes.title} content={notes.content}/>
        <Footer />

    </div>);
}
export default App;
